webpackJsonp([88902560777581],{619:function(e,n){e.exports={data:{markdownRemark:{html:'<h3>Hacker Skills</h3>\n<p>The new Hacker Skills feature enables hackers to identify their skill set which enables them to qualify for invitations specific to their skill sets. Each skill a hacker puts will be verified by HackerOne.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2016_hacker_skills-37de049197dfef56b8da9d34e7e2be85-6ab1b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 32.95395757889291%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2016_hacker_skills"\n        title=""\n        src="/static/nov_2016_hacker_skills-37de049197dfef56b8da9d34e7e2be85-2f183.png"\n        srcset="/static/nov_2016_hacker_skills-37de049197dfef56b8da9d34e7e2be85-67829.png 125w,\n/static/nov_2016_hacker_skills-37de049197dfef56b8da9d34e7e2be85-5c59f.png 250w,\n/static/nov_2016_hacker_skills-37de049197dfef56b8da9d34e7e2be85-2f183.png 500w,\n/static/nov_2016_hacker_skills-37de049197dfef56b8da9d34e7e2be85-c93e8.png 750w,\n/static/nov_2016_hacker_skills-37de049197dfef56b8da9d34e7e2be85-4e628.png 1000w,\n/static/nov_2016_hacker_skills-37de049197dfef56b8da9d34e7e2be85-b3ac4.png 1500w,\n/static/nov_2016_hacker_skills-37de049197dfef56b8da9d34e7e2be85-6ab1b.png 1933w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Configure SLAs for Triage and Resolution</h3>\n<p>We enable programs to set internal Service Level Agreements (SLAs) by configuring the amount of time that can elapse before a report is marked for their program.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2016_configure_sla-933b418623cb8f933c52cae421f94483-4452e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.011049723756905%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2016_configure_sla"\n        title=""\n        src="/static/nov_2016_configure_sla-933b418623cb8f933c52cae421f94483-2f183.png"\n        srcset="/static/nov_2016_configure_sla-933b418623cb8f933c52cae421f94483-67829.png 125w,\n/static/nov_2016_configure_sla-933b418623cb8f933c52cae421f94483-5c59f.png 250w,\n/static/nov_2016_configure_sla-933b418623cb8f933c52cae421f94483-2f183.png 500w,\n/static/nov_2016_configure_sla-933b418623cb8f933c52cae421f94483-c93e8.png 750w,\n/static/nov_2016_configure_sla-933b418623cb8f933c52cae421f94483-4e628.png 1000w,\n/static/nov_2016_configure_sla-933b418623cb8f933c52cae421f94483-4452e.png 1448w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Change Report State via API</h3>\n<p>We enable you to change the state of a report through utilizing our API.</p>\n<h3>Export as .zip</h3>\n<p>We provide a new export option where you can download the contents of the report and all attachments in a single zip archive.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2016_export_zip-2b2da43fc3b5f0cf7ede739c0c1de7a2-adff2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.602023608768974%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2016_export_zip"\n        title=""\n        src="/static/nov_2016_export_zip-2b2da43fc3b5f0cf7ede739c0c1de7a2-2f183.png"\n        srcset="/static/nov_2016_export_zip-2b2da43fc3b5f0cf7ede739c0c1de7a2-67829.png 125w,\n/static/nov_2016_export_zip-2b2da43fc3b5f0cf7ede739c0c1de7a2-5c59f.png 250w,\n/static/nov_2016_export_zip-2b2da43fc3b5f0cf7ede739c0c1de7a2-2f183.png 500w,\n/static/nov_2016_export_zip-2b2da43fc3b5f0cf7ede739c0c1de7a2-adff2.png 593w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{path:"/changelog/2016/november",title:"November 2016"}}},pathContext:{}}}});
